import React from 'react'

const Footer = () => {
  return (
    <div className='d-flex'>
      <div className='h-100 w-75 mx-auto border'>
        <img className='truck' src="https://images.mamaearth.in/wysiwyg/delivery2x.png"></img>
        
        <img className='truck' src="https://images.mamaearth.in/wysiwyg/Group_81512x.png"></img>
      </div>
    </div>
  )
}


export default Footer
